Militkaptito estas soldato aŭ militisto, tenita fare de la malamiko post esti kaptita dum armita konflikto inter landoj, aŭ senpere post ĝi. Internaciaj konvencoj reguligantaj traktadoj kun kaptitoj (nuntempe ĉefe la 3-a ĝeneva konvencio el la 12-a de aŭgusto 1949) krom alia destinas, ke militkaptitoj ne devas esti torturataj nek murdataj, kaj specifikas informojn, kiujn la kaptito estas devigita sciigi al malliberigantoj: nomo, dato de naskiĝo, rango kaj deĵornumero. Kiel militkaptitoj oni konsideras personojn de tiuj ĉi kategorioj: 
* Anoj de regulaj armitaj fortoj inkluzive de almembrigitaj milicoj; 
* Personoj, kiuj ne estas armeaj personoj, sed ili estas agadaj por armitaj fortoj; 
* Loĝantaro de atakita regiono, kiu ekvidinte proksimiĝantan malamikon ekprenis armilon. Ankaŭ ĉiujn ceterajn personojn, kiuj faris militagadojn, estas necese okaze de duboj konsideri kiel militkaptitojn, ĝis kiam apartenanta juĝo ne decidis pri ilia statuto. La militkaptitoj subiĝas al la potenco de ŝtato, kiu militkaptis ilin, ne al personoj aŭ armeaj taĉmentoj, kiuj militkaptis ilin. Bedaŭrinde okazis esceptoj, en Hungario en fino de la 2-a mondmilito la Ruĝa Armeo havis kvantan ordonon, kiu ne sufiĉis el la hungaraj soldatoj, tial estis kaptitaj ankaŭ simplaj civiluloj. Militprizono (ofte ankaŭ malliberejo por militprizonuloj) estas ejo por la enfermado de malamikaj luktintoj kaptitaj de militanta potenco dum militepoko. Kaptitula interŝanĝo estas interkonsento inter oponanta flankoj en konflikto liberigi kaptitojn: militkaptitoj, spionoj, ostaĝoj, ktp. Foje, ankaŭ mortintaj korpoj estas interŝanĝitaj.
